import {Container, Row, Col} from 'react-bootstrap';
import PostForm from "./PostForm";
import PostList from "./PostList";

function App() {

  return (
<Container>
        <Row className="justify-content-md-center" style={{marginTop: 60}}>
          <Col xs lg="2">
          <h1 style={{testAlign: 'center'}}>Blog App</h1>
          </Col>
        </Row>
        <Row className="justify-content-md-center" style={{marginTop: 60}}>
          <Col xs lg="2">
          <PostForm/>
          </Col>
        </Row>
        <Row className="justify-content-md-center" style={{marginTop: 60}}>
          <Col xs lg="2">
          <PostList/>
          </Col>
        </Row>
      </Container>
  );
}

export default App;
